import React from 'react';
import PropTypes from 'prop-type';

class Rating extends React.Component {
  render() {
    return (
      <p>{ this.props.rating }</p>
    );
  }
}

Rating.propTypes = {
  rating: PropTypes.number,
};

export default Rating;
